(95, 'Test Project', '<p><img src=\"data:image/jpeg;base64,\" data-filename=\"software.jpeg\" style=\"width: 535.6px;\"></p><h2 id=\"how-it-works\" style=\"margin-top: 3rem; line-height: 1.2; font-size: 2rem; pointer-events: none; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\"><span class=\"bd-content-title\" style=\"display: block; pointer-events: auto;\">How it works<a class=\"anchorjs-link \" href=\"https://getbootstrap.com/docs/4.3/components/modal/#how-it-works\" aria-label=\"Anchor\" data-anchorjs-icon=\"#\" style=\"color: rgba(0, 123, 255, 0.5); opacity: 0; -webkit-font-smoothing: antialiased; transition: color 0.15s ease-in-out 0s, opacity 0.15s ease-in-out 0s; padding-left: 0.375em;\"></a></span></h2><p style=\"margin-bottom: 1rem; max-width: 80%; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Before getting started with Bootstrap’s modal component, be sure to read the following as our menu options have recently changed.</p><ul style=\"max-width: 80%; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><li style=\"margin-bottom: 0.25rem;\">Modals are built with HTML, CSS, and JavaScript. They’re positioned over everything else in the document and remove scroll from the&nbsp;<code class=\"highlighter-rouge\" style=\"font-size: 14px;\">&lt;body&gt;</code>&nbsp;so that modal content scrolls instead.</li><li style=\"margin-bottom: 0.25rem;\">Clicking on the modal “backdrop” will automatically close the modal.</li><li style=\"margin-bottom: 0.25rem;\">Bootstrap only supports one modal window at a time. Nested modals aren’t supported as we believe them to be poor user experiences.</li><li style=\"margin-bottom: 0.25rem;\">Modals use&nbsp;<code class=\"highlighter-rouge\" style=\"font-size: 14px;\">position: fixed</code>, which can sometimes be a bit particular about its rendering. Whenever possible, place your modal HTML in a top-level position to avoid potential interference from other elements. You’ll likely run into issues when nesting a&nbsp;<code class=\"highlighter-rouge\" style=\"font-size: 14px;\">.modal</code>&nbsp;within another fixed element.</li><li style=\"margin-bottom: 0.25rem;\">Once again, due to&nbsp;<code class=\"highlighter-rouge\" style=\"font-size: 14px;\">position: fixed</code>, there are some caveats with using modals on mobile devices.&nbsp;<a href=\"https://getbootstrap.com/docs/4.3/getting-started/browsers-devices/#modals-and-dropdowns-on-mobile\">See our browser support docs</a>&nbsp;for details.</li><li style=\"margin-bottom: 0.25rem;\">Due to how HTML5 defines its semantics,&nbsp;<a href=\"https://developer.mozilla.org/en-US/docs/Web/HTML/Element/input#attr-autofocus\">the&nbsp;<code class=\"highlighter-rouge\" style=\"font-size: 14px;\">autofocus</code>&nbsp;HTML attribute</a>&nbsp;has no effect in Bootstrap modals. To achieve the same effect, use some custom JavaScript:</li></ul>', 'thank you by admin', '2019-06-27 20:37:22', '2019-06-27 20:37:22');

